var parallax=function(a){if(!($(window).width()<768)){var t=$(".parallax").width()/2,l=$(".parallax").height()/2,n=$(".parallax").offset(),o=a.pageX,s=a.pageY-n.top,r=(o-t)/30,e=(s-l)/30;$('.parallax [class*="wave"]').each((function(a){$(this).css({transition:"",transform:"translate3d("+a*r+"px,"+a*e+"px,0px)"})}))}},stopParallax=function(){$('.parallax [class*="wave"]').css({transform:"translate(0px,0px)",transition:"all .7s"}),$timeout((function(){$('.parallax [class*="wave"]').css("transition","")}),700)};$(document).ready((function(){$(".not-found").on("mousemove",parallax),$(".not-found").on("mouseleave",stopParallax)}));